import React, { useState, useEffect } from 'react';
import axios from 'axios';

function Home() {
  const [urls, setUrls] = useState([]);

  useEffect(() => {
    axios.get('http://localhost:5000/urls') // update this if needed
      .then(response => setUrls(response.data))
      .catch(error => console.error(error));
  }, []);

  return (
    <div>
      <h2>Saved URLs</h2>
      <ul>
        {urls.map(url => (
          <li key={url._id}>
            <a href={`/read/${url._id}`}>{url.title || url.url}</a>
          </li>
        ))}
      </ul>
    </div>
  );
}

export default Home;
